import React from "react";
import { FooterBase } from "./styles";

function Footer() {
  return (
    <FooterBase>
      <a href=" https://portal.mch.ifsuldeminas.edu.br//" target="_blank">
        IFSULDEMINAS
      </a>
      <p>Todos Direitos Reservados - 2022</p>
    </FooterBase>
  );
}
export default Footer;
